import React from 'react';
import axios from 'axios' 
import imgkonfhub from '../components/images/512.png'

const style = {
    marginBottom:'10px',
    marginLeft: '10px',
    marginRight: '10px'
}

const apiId = 'gdgnag'


const getlogin = () => {
    axios.get('https://dstc324xgg.execute-api.us-east-2.amazonaws.com/test/registration_authentication/"{apiId}"')
    .then(function (response) {
      // handle success

       console.log(response);


    })
}

function checkLogin(){
    return(
        <div className="bodyLogin">
        <div className="has-text-centered ">
        <img  src={imgkonfhub}  height="62" width="62"/>
        </div>
        <div style={style}>     
        <input className="input is-primary marginLR" name="id" placeholder='Event Id'  />
        </div>
        <div className="has-text-centered">
        <button className="button is-primary is-normal radiusBtn">Login</button>
        </div>
        </div>
    )
}
export default checkLogin;
